import React from "react";

const Navlink = () => {
  const links = [
    {
      name: "men",
      submenu: true,
      sublinks: [
        {
          Head: "topwear",
          sublink: [
            { name: "T-shirt", link: "/" },
            { name: "T-shirt", link: "/" },
            { name: "T-shirt", link: "/" },
            { name: "T-shirt", link: "/" },
          ],
        },
      ],
    },
    { name: "women" },
    { name: "kids" },
  ];
  return (
    <div>
      {links.map((item) => (
        <div>
          <div className=" px-3 text-left md:cursor-pointer">
            <h1 className="py-7 ">{item.name}</h1>
            {item.submenu && (
              <div>
                <div>
                  <div>
                    {item.sublinks.map((mysublinks) => [
                      <div>
                        <h1>{mysublinks.Head}</h1>
                        {mysublinks.sublink.map((slink) => (
                          <li>{slink.name}</li>
                        ))}
                      </div>,
                    ])}
                  </div>
                </div>
              </div>
            )}
          </div>
        </div>
      ))}
    </div>
  );
};

export default Navlink;
